import "./App.css";

import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component";

const Menu = () => {
  return <h1>Menu page</h1>;
};

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
    </Routes>
  );
};

export default App;
